import React, { useEffect, useState, useRef } from 'react';
import { getWisata } from '../api';
import { Container, Row, Col, Card, Carousel } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import '../App.css'; // Pastikan file CSS ada untuk animasi

const Home = ({ language, darkMode }) => {
    const [wisataList, setWisataList] = useState([]);
    const navigate = useNavigate();

    const aboutRef = useRef(null);
    const destinationRef = useRef(null);

    const handleScroll = () => {
        const aboutSection = aboutRef.current;
        const destinationSection = destinationRef.current;
        const triggerPoint = window.innerHeight / 1.2;

        if (aboutSection) {
            const aboutTop = aboutSection.getBoundingClientRect().top;
            if (aboutTop < triggerPoint) {
                aboutSection.classList.add('fade-in');
            }
        }

        if (destinationSection) {
            const destinationTop = destinationSection.getBoundingClientRect().top;
            if (destinationTop < triggerPoint) {
                destinationSection.classList.add('fade-in');
            }
        }
    };

    useEffect(() => {
        getWisata().then(data => setWisataList(data));
        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    return (
        <Container fluid className={`mt-5 pt-5 ${darkMode ? "dark-mode" : ""}`}>

            {/* Gambar Slider */}
            <Carousel className="carousel-container">
                <Carousel.Item>
                    <img className="d-block w-100 carousel-img" src="/images/slide1.jpg" alt="Slide 1" style={{ height: "60vh" }} />
                </Carousel.Item>
                <Carousel.Item>
                    <img className="d-block w-100 carousel-img" src="/images/slide2.jpg" alt="Slide 2" style={{ height: "60vh" }} />
                </Carousel.Item>
                <Carousel.Item>
                    <img className="d-block w-100 carousel-img" src="/images/slide3.jpg" alt="Slide 3" style={{ height: "60vh" }} />
                </Carousel.Item>
            </Carousel>

            {/* Tentang Benteng Keraton Buton */}
            <Container className="mt-5 section" ref={aboutRef}>
                <h2 className="text-center section-title">
                    {language === "id" ? "Tentang Benteng Keraton Buton" : "About Benteng Keraton Buton"}
                </h2>
                <p className="text-center">
                    {language === "id"
                        ? "Benteng Keraton Buton adalah salah satu benteng terbesar di dunia yang terletak di Kota Baubau, Sulawesi Tenggara. Benteng ini memiliki sejarah panjang yang berkaitan dengan Kesultanan Buton, dan menawarkan pemandangan indah serta warisan budaya yang kaya."
                        : "Benteng Keraton Buton is one of the largest fortresses in the world, located in Baubau City, Southeast Sulawesi. This fortress has a long history related to the Buton Sultanate and offers beautiful views and rich cultural heritage."
                    }
                </p>
                <hr className="section-divider" />
            </Container>

            {/* Daftar Wisata */}
            <Container className="mt-5 section" ref={destinationRef}>
                <h2 className="text-center section-title">
                    {language === "id" ? "Destinasi Wisata" : "Tourist Destinations"}
                </h2>
                <Row>
                    {wisataList.length > 0 ? (
                        wisataList.map(wisata => (
                            <Col key={wisata.id} md={3} xs={6} className="mb-4">
                                <Card className={`shadow-sm ${darkMode ? "dark-card" : ""}`}
                                    onClick={() => navigate(`/detail/${wisata.id}`)}
                                    style={{ cursor: 'pointer' }}>
                                    <Card.Img variant="top" src={`/images/${wisata.gambar}`} />
                                    <Card.Body className="text-center">
                                        <Card.Title>{wisata.nama}</Card.Title>
                                    </Card.Body>
                                </Card>
                            </Col>
                        ))
                    ) : (
                        <p className="text-center">
                            {language === "id" ? "Tidak ada destinasi wisata tersedia." : "No tourist destinations available."}
                        </p>
                    )}
                </Row>
            </Container>
        </Container>
    );
};

export default Home;
